PROTECTED STRUCTURE: Development at 10 Dartmouth Square, Ranelagh, Dublin 6, listed as a protected structure in the Dublin City Development Plan 2011-2017 (Record of Protected Structures Ref. 2156) and located in an Architectural Conservation Area. The proposed development consists of alterations and renovations to a single-family terraced dwelling, plus general work to the protected structure comprising: - ground floor extension ( 14.5 sq.m) to existing rear garden to form open plan kitchen, dining room and study; 
- first floor extension ( 5 sq.m) to provide bathroom; 
- removal of a section of existing wall on garden level to connect living room and kitchen dining room;
- removal of existing bathroom at second floor level above staircase;
- removal of partition walls on second floor and repartitioning of bedrooms;
- alterations to rear elevation including new doors to garden and one new window to both ground and first floor extension;
- installation of new roof lights over extension and new rooflights to slope of main roof;
- removal of existing window to ensuite and blocking up to match existing;
- installation of new kitchen, bathroom and utility room facilities;
- re-glazing of existing timber single-glazed sash windows with double-glazed conservation grade units to match existing;
- installation of new mechanical and electrical services throughout;
- sundry repairs, renewals and alteration works- not impacting on the special interest of the protected structure - to facilitate the works outlined above.

PROTECTED STRUCTURE: The development will consist of:
-the refurbishment of existing roof; 
-the demolition of existing single storey rear sunroom extension;
-the provision of a new single storey rear extension including 3 no. roof lights;
-general internal alterations;
-refurbishment and associated site works.

The development will consist of the amendment of a previously permitted development under Dublin City Council Reg.Ref. 3737/09, as subsequently amended by DCC Planning Ref. 3896/15. The proposed amendments to the previously permitted development involves internal and external alterations to the building to include:
(a) The extension of basement area by approximately 85 sq.m to provide a reconfigured layout to showers, w/c facilities, cycle storage areas and to provide an additional third lift core;
(b) Internal alterations and reconfiguration of the ground floor layout to provide for the amalgamation of the previously permitted 2 no. retail units into a single unit at the eastern end of the building together with an associated change of use of the amalgamated unit from retail (210 sq.m) to café use (210 sq.m), and provision for outside seating along the Hogan Place frontage. Other alterations at ground floor level include minor alteration to the location and configuration of the permitted entrance, and minor alteration of the adjoining facade to integrate with the facade above along Harmony Row and Hogan Place, together with a revised layout to the internal lobby and reception area and reconfiguration of previously permitted ground floor office use areas on both sides of the revised entrance. Associated external alterations at ground floor include revised ground floor fenestration, steps and access ramp to the new entrance;
(c) Provision of a first floor void above the reconfigured entrance and associated reduction in floor area (58 sq.m); and
(d) Provision of additional plant area at roof level including an air extraction unit associated primarily with the proposed café use (90 sq.m) and associated low level screening to match the permitted plant screen.

The development will consist of :-
(a) The refurbishment and retrofit of the existing social housing complex including the addition of two new floors of accommodation over the existing building, the total area of the completed development is c.8550 sq.m over 6 storeys, providing a total of 80 no. apartments with associated balconies;
(c) 23 no. 1 bed apartments, 44 no. 2 bed apartments, 2 no. 3 bed apartments, 8 no. 3 bed duplex units and 3 no. 4 bed apartments;
(d) The removal of the existing railed green area at Gloucester Place Lower and provision of new open space and entrance plaza;
(e) The removal of Gloucester Lane to the east and adjacent railed green space to provide secure residents parking with 27 no. car parking spaces;
(f) The provision of new stair and lift cores between the existing blocks to enclose the central courtyard as a private amenity space;
(g) The relocation of the main entrance to Gloucester Place Lower to provide secure access to the housing complex;
(h) A new site boundary from the building face to the existing eastern boundary at Gloucester Lane comprising new railings to an overall height of 2.4 m, and including a new gated vehicular entrance off Railway Street and new pedestrian gates from Railway street and Seán MacDermott Street securing and residents parking area,
(i) Entrance doors to ground floor apartment units directly from street level, including new landscaped front gardens and 1.1 m high railings;
(j) New signage comprising wall mounted lettering c.300mm in height along the Gloucester Place Lower building facade;
(k) 20 no. bicycle parking spaces with the building curtilage accessed from the central courtyard
(l) The removal of all existing trees at Gloucester Place Lower and Gloucester Lane and the provision of new soft & hard landscaping to the open space at Gloucester Place Lower, Gloucester Lane and the central courtyard;
(m) All Associated ancillary site development works.

The development will consist of 
(i) Demolition of existing two storey dwelling
(ii) Construction of replacement detached five bedroom two-storey over basement dwelling with attic accommodation to include 2 no. front dormer windows and 2 no. rear dormer windows;
(iii) Basement car lift / storage area;
(iv) SuDS drainage; private amenity space, boundary treatments landscaping and all associated site works.

RETENTION: The development consists of Retention Planning Permission for the following:
1) Demolition of previously constructed extension to rear of dwelling house;
2) Construction of existing extension to rear of dwelling house;
3) Conversion of attic space to habitual area;
4) Construction of porch to front elevation;
5) Demolition of garage to side of property.
Along with all ancillary services and associated site works.

Permission is sought for alterations to include: 
A) Demolition of existing lean-to extension (29 sqm) at lower ground floor and rear return at first floor (6sq.m);
B) The change of use of the building from offices to residential with 3 one bed apartments and 1 one bed live/work unit:
C) Construction of an additional floor at roof level and full height extension to the rear (total 158 sqm) including balconies at 1st, 2nd and 3rd floor levels;
D) All associated internal modifications to the existing layout.

Permission for development of an Apartment Block for the elderly in association with Fold Ireland (Housing Association) at Site of former Smurfit Kappa Facility, Tonlegee Road, Coolock, Dublin 5. The proposed development will comprise of;
(a) the construction of a New 3 Storey residential apartment Block comprising of 47 residential units plus associated ancillary administration office (Area of building 3,409 sq.m.) with balconies at first & second floor levels to South, West, North & East elevations; 
(b) a standalone single storey ESB Sub-station and switch room (Area of building 22.5 sq.m.);
(c) a standalone single storey Bin Storage shed (Area of building 18.2 sq.m.);
(d) open spaces, landscaping, 26 No. car parking spaces, bike shelters for 24 No. bike spaces, and all associated site works and infrastructure.
The overall site has a total area of 5,575 sq.m.

The development will consist of amendments to the planning permission granted under Register Reference 2528/14 (An Bord Pleanála Reference PL29N.243918) comprising:
i) amendments to the approved part two storey, part three storey building ('Block A') in front of the supermarket building to the south of the entrance to the site, to replace the approved extension to the retail floor space of the supermarket and retail floor space on ground floor with a 314 sq.m restaurant; to replace the approved commercial units and crèche facility on the first and second floors with 4 no. two bed duplex apartments with balconies at first floor facing onto Vernon Avenue and screened terraces at second floor level at the rear facing into the site; to omit the approved enclosed crèche play area at first floor roof level; to extend the first floor to the rear to provide an additional 82 sq.m supermarket office and staff accommodation; and alterations to the design, fenestration and materials of the approved elevations;
ii) amendments to the approved three storey building to the north of the entrance to the site ('Block B') to provide an additional 17 sq.m retail floor area at ground floor; replace the approved commercial units at first and second floor with 2 no Two bed duplex appartments with balconies at first floor facing onto Vernon Avenue and screened terraces at second floor level to the rear facing into the site; and alterations to the design, fenestration and materials of the approved elevations;
iii) provision of 8 no. car parking spaces and a 31 sq.m external seating area for the proposed restaurant in front of Block A and redesign of the parking area in front of Block B to provide 4 no. spaces;
iv) provision of a 130 sq.m plant room on the roof of the existing supermarket building; and
v) all other site development works associated with the proposed development including paving and landscaping and the provision of retractable canopies on the Vernon Avenue elevations of Blocks A and B.

KW Investment Funds ICAV on behalf of KW Investment Fund I, intend to apply for planning permission at a site (0.519 ha) at No. 5 Schoolhouse Lane East, Dublin 2. The development will consist of:

-An increase in overall gross floor area of the existing 5-storey office building from c.1,643 sq.m gfa to c.1,814 sq.m gfa, arising from: the infill of an existing internal void below at 2nd floor level and the lateral extension of the building to the east at set back 3rd floor level; 
-the lateral extension of the building to the east and south at set back 4th floor level, and;
-an extension southward of the recessed area at ground floor level so as to be flush with the front building line to Schoolhouse Lane East established by the existing reception area at ground floor level;

-partial alterations to the existing facade associated with the above works and an associated signage zone (0.22 m by 4.3m) above the ground floor entrance;
-the relocation of bin storage, a new bicycle parking area for 10 no. spaces, and the reconfiguration of external plant area with associated ancillary works, all to the rear of the building at ground level;

-and other internal reconfiguration works from ground to 4th floor level as exempted development.

Irish Life Assurance plc intends to apply for planning permission for development at a site of c. 0.42 ha. The proposed development includes demolition of the existing front entrance to the blocks and its replacement with an extended new entrance, a complete redesign of the front entrance plaza and replacement of all of the existing reflective and opacified glass with clear glass throughout both blocks. The application includes the following main elements:
1) Demolition of existing four storey-quadrant-shaped entrance element (20.600 m high, 214 sq.m) to the front of Blocks C and D, including the quadrant-shaped set-back fifth floor with pitched metal roof;
2) Construction of a new extended orthogonal-shaped entrance element (20.860 m high, 840 sq.m) comprising a central raised five-storey high glass box element and flanking four-storey stone-framed element with set-back fifth floor, all with clear glazing;
3) Removal of the existing colonnaded pergola and railings (including the central stone gateway element) at street level enclosing the front entrance plaza;
4) New hard and soft landscaping to the entrance plaza including the extension of the steps fronting onto George's Quay, installation of planters and benches,installation of glass balustrades and foldable glass screens to visually open up the plaza and provision of lighting of the plaza at night-time;
5) Replacement of all existing reflective and opacified glazing to the Block C and D facades with clear glazing;
6) Temporary removal (for duration of works) of part of two bus stop/ coach set-down areas along east side of Moss Street South (subject to agreement with Dublin City Council; and
7) All associated and ancillary development and site works above and below ground.

PROTECTED STRUCTURE: Planning Permission is sought for alterations to previously approved developments Reg. Ref. 2173/15 and Reg. Ref. 4030/15. The alterations comprise:
(i) replacement roof with the ridge height increased by 1.05 metres and provision of 2no. apex roof lights; 
(ii) approved mezzanine level extended to 169sq.m;
(iii) feature clerestory glazing below the eaves level on the south and north elevations;
(iv) 1.9 metre diameter aluminium framed circular window to the east and west elevations;
(v) additional 4no. high level steel framed windows on northern elevation; 
(vi) approved entrance doors on east and west elevations reduced in width from 3.5 metres to 3.0 metres, and provision of level access, with cobble stone finish, to both of these entrances; and
(vii) all ancillary works necessary to facilitate the development.

The development will consist of:
- The demolition of the rear buildings on to Synnott Row, comprised of a 2-storey rear extension to the front building and a mews house;
- The refurbishment of the 3-storey over basement front building on to Synnott Place to provide a new single family house;
- The removal of the shopfront and the reinstatement of the basement area and railings to match adjoining premises on Synnott Place;
- The construction of a rear replacement building on to Synnott Row, containing a two storey 2-bed townhouse with an external terrace at roof level.

PROTECTED STRUCTURE: RETENTION: The development consists of the retention of the following all on the eastern side of Block C (formally Rathgar House) of the nursing home: 
1. A single storey room (kitchen and stores) at lower ground level in place of a single storey food preparation room; and a covered walkway approved under Register Reference 2212/13 (PL29S.241956); 
2. A freestanding platform lift and supporting structure between lower ground and ground floor levels;
3. A walkway with handrails and gates between the front (north) of Block C and the upper level of the platform lift for service and emergency access;
4. A stairway linking the lower ground level and the walkway;
5. Ground mounted air handling units and input flue to service the adjoining kitchen at lower ground level and wall mounted refrigeration units on the existing extension to Block C to service the adjoining cold store at lower ground floor;
6. An extract flue from the kitchen at lower ground floor level on the eastern elevation of an existing extension to Block C to service the adjoining cold store at lower ground floor;
7. A fire escape only door constructed from a ground floor window opening in the eastern elevation of Block C.

Permission is sought for development consisting of:
(A) Demolition of existing single-storey flat-roofed extension to rear of 37.0 sq. m., together with existing chimney;
(B) Single-storey pitched roof extension to the rear of 48.5 sq.m.;
(C) Attic conversion of 25.0 sq.m., incorporating new dormer window and roof extension to rear;
(E) 2 No. new velux windows; 1 No. over the new stairs in the North West roof and 1 No. over the en-suite bathroom in the North East roof:
(F) New opes at ground floor level; 1 No. window on the North East facing (Front) elevation and 1 No. door on the South West facing (Rear) elevation;
(G) Relocation of an existing window in the South-East facing (side) elevation:
(H) Extension of existing pitched roof over existing flat-roofed single-storey area to side of house;
(J) Provision of new external wheelchair access ramp and hand rails to the front entrance;
(K) Increase in width of entrance gate from 2.5M to 3.3M.

The development comprises of works to the Port's private internal road network, and includes works on public roads at East Wall Road, Bond Road and Alfie Byrne Road. The development will consist of: 
a) Construction of new roads and enhancements to existing roads within the Dublin Port estate north of River Liffey;
b) Construction of enhanced landscaping and amenity route along the northern boundary;
c) Construction of new pedestrian and cycle overbridge at Promenade Road;
d) Construction of access ramps to pedestrian and cycle overbridge at Promenade Road;
e) Construction of new pedestrian and cycle underpass at Promenade Road;
f) Construction of 11 no. new signage gantries;
g) Ancillary construction works, including site clearance, demolitions, earthworks, pavement construction, construction of verges, modifications to accesses, construction of new and amended drainage services, diversion and installation of utility services, installation of road markings and signs and accommodation works;
h) Works to existing boundaries and construction of new boundaries;
i) Construction of minor works to the junctions of East Wall Road with Tolka Quay Road and East Wall Road with Alexandra Road.
The application is for a 10 year planning permission.

The development will comprise of: 
- the demolition of an existing two-storey storage building (345 sq.m); 
- the construction of a new 4-storey office and training centre building (776.5 sq.m) with associated toilets, internal circulation including shared stairway and lift and roof mounted solar panels; 
- alterations to plans and elevations of the existing rear 2-storey hair academy building incorporating new fire exits located at the rear of the site; - connection to existing site services;
- alterations to site boundaries and ancillary site development works.
The new building will comprise as follows:
- 8 bicycle stands and external amenity space;
- 181 sq.m of entrance foyer, offices and training centre with associated signage at ground floor level incorporating a pedestrian link;
- 198.5 sq.m of offices and training centre at first floor level;
- 198.5 sq.m of offices and training centre to the second floor;
- 198.5 sq.m of offices and training centre at third floor level.
The proposed building is set back a minimum of 8m from the existing water edge to the Camac River edge along the north site boundary.

PROTECTED STRUCTURE:
Development on a site of c.0.0688 hectares. No. 75 Camden Street Lower (incorporating No. 75A Camden Street Lower, which is a Ground Floor Level shop unit) is a Protected Structure.
The proposed development consists of: 
- the demolition of the rear single storey extensions to Nos. 75 and 76 Camden Street Lower (c. 38.4 sq.m gross floor area);
- the provision of a new single storey link (c. 73.5  sq.m net floor area) comprising shop use (to accommodate use Class 1 of Schedule 2 Part 4 of the Planning and Development Regulations 2001-2015) connecting the Ground Floor Levels of Nos. 75 and 76 Camden Street Lower to the Ground Floor Level of No. 41A Pleasants Street;
- the change of use of the Ground Floor Level of No. 41A Pleasants Street from a former service garage/ car sales to shop (to accommodate use Class 1, of Schedule 2, Part 4 of the Planning and Development Regulations 2001-2015) (c. 359.3 sq.m net floor area);
- and the continued use of the existing shops at Ground Floor Levels of Nos. 75 and 76 Camden Street Lower.
These works will result in the provision of one shop unit (from two existing shop units and former service garage/ car sales) measuring c. 523 sq.m net floor area. There are no changes proposed to the size of the existing shop unit (c. 20.8 sq.m net floor area) at Ground Floor Level of No. 75A Camden Street Lower. A new circulation space (lobby) (c. 6 sq.m net floor area) connecting the new link to No. 75A Camden Street Lower and the First and Second Floor Levels of Nos. 75 and 76 Camden Street Lower is also proposed.
The proposed development results in a gross floor area of c. 602.9 sq.m (including ancillary space such as circulation cores and walls) at Ground Floor Level of the subject site. 
The proposed development also consists of the refurbishment of Nos. 75 (which includes No. 75A) and 76 Camden Street Lower comprising alterations and repairs to the buildings where appropriate including: the removal of an existing WC extension from the rear facade of No. 75 (c. 3.1 sq.m gross floor area) and associated repairs; the replacement of the existing shop fronts to Nos. 75, 75A and 76; the enlargement of existing opes in the rear walls of Nos. 75 and 76 at Ground Floor Level to allow connection with the proposed new shop link to No. 41A Pleasants Street; the refurbishment and replacement of windows where necessary; and the refurbishment of the existing office spaces at First and Second Floor Levels of Nos. 75 and 76, including the creation of new WC, lobbies and kitchenettes on each floor, and alterations to existing partitions on each floor where applicable. A terrace is proposed on part of the roof of the new single storey link, with associated guard rail to the terrace's southern perimeter. The development will also consist of associated internal and elevational alterations to No. 41A Pleasants Street; all hard and soft landscaping; changes in level; associated site servicing (foul and surface water, drainage and water supply); and all other associated site excavation and site development works above and below ground.

PROTECTED STRUCTURE: RTÉ intend to apply for planning permission for development at a 2.52 hectare site at the RTE Campus. The application site is located partly within the curtilage of Montrose House, a Protected Structure. The proposed development comprises the following:
A new access/egress to the lands from the R138 (Stillorgan Road). The proposed access/egress junction comprises of a two lane road with footpaths, pedestrian crossings and landscaping, and amendments to existing internal road network at the RTE lands, and will create a new public plaza entrance to the RTE lands;
The closure of the existing main (south-easterly) access/egress to the RTE lands from Nutley Lane, except for emergency access, and associated new boundary treatment;
Reconfiguration of existing surface car parking area on the RTE lands at the access/egress junction, provision of surface car parking area opposite the existing (proposed to be closed off) Nutley Lane entrance, resulting in the net loss of 25 no. car parking spaces to accommodate the proposed access/egress;
The demolition of the existing single storey crèche building on the RTE lands to facilitate the proposed new access/egress;
Works to Stillorgan Road, including new westbound right turn lane to RTE lands, new eastbound left turn lane to RTE lands, provision of a new central median, pedestrian crossings, realignment of road markings, new footpaths and cycle lanes, and other associated and ancillary works;
All associated and ancillary works, including hard and soft landscaping, new boundary treatment, surface water drainage works, relocation of existing security barriers, and relocation of existing flagpoles from Nutley Lane entrance to new access/egress junction.

Construction and completion of a new five storey mixed use development, comprising:
(i) 1 no. retail unit at ground floor level and 
(ii) 5 no. apartments over first, second, third and fourth floor levels (3 no. one bedroom, 1 no. two bedroom and 1 no. three bedroom); south facing balconies/ terraces to each apartment, together with semi-private roof terrace at first and fourth floor levels; private store/ cycle store and communal bin store at ground floor level;
(iii) roof mounted solar panels;
(iv) SuDS drainage and all associated works necessary to facilitate the development.
A similar development of five storeys was previously approved on the site under Reg.Ref. 4897/07/ Ref. PL29S.226310 (which has commenced site works/ enabling works).

The following proposed works:
1) Provide off-street parking in front garden; 
2) Enlarge the existing pedestrian entrance to provide new vehicle entrance gate off Howth Road.

Avam Limited intend to apply for planning permission for development at a 513 sq.m site located at 48-50 Cuffe Street to the Southside of Cuffe Street and to the east of Wexford Street, Dublin 2. The proposed development comprises of the following:
The construction of a 2,440 sq.m gross office development of six storeys with setbacks at the fifth and sixth storeys to the south elevation and at the sixth storey at the north, south and west elevations;
Provision of 2 no. ground floor entrances from Cuffe Street to an own door ground floor office and to lobby/ stairway to offices on upper floors. The development also includes pedestrian access from Protestant Row;
Provision of 50 no. bicycle parking spaces, showers, changing and locker facilities, plant areas, waste storage and other ancillary areas at ground floor level;
The development includes all associated site development works, hard and soft landscaping, roof plant and all other ancillary works.

PROTECTED STRUCTURE: The development will consist of:
1. Alterations and demolition works to existing extension / return to rear of existing two storey end-of-terrace dwelling house;
2. Demolition of existing utility out-building to side;
3. Formation of new door openings in existing walls of house;
4. Installation of 2 no. new velux roof lights into roof of existing rear extension;
5. Minor alterations to existing internal layout of house including provision of new ensuite bathroom to 1st floor bedroom;
6. Construction of new single storey extensions (with roof lights) to the rear, and also side (facing Ormond Road South) together with associated drainage and ancillary site works.

RETENTION: Minor alterations to previously approved development Reg.Ref. WEB1134/11. Alterations comprise the following:
(i) Rear dormer windows changed from flat roof to pitched roof;
(ii) Relocation of chimney on western roof slope;
(iii) Provision of a hipped roof dormer to the western roof slope with permanent opaque glazing;
(iv) Outer wall on western elevation altered from angled to stepped alignment with no increase in floor area and omission of 2 no. windows;
(v) Ground floor extension to rear extended in depth by 0.3 m and stepped in from the western elevation by 0.37 m with door ope changed to window ope;
(vi) Provision of internal steps and reduced floor level to kitchen/ dining/ living area at rear.

The development will consist of:
(i) Demolition of existing structures on the site; 
(ii) Construction off 3no. dwellings, comprising 1no. two-storey, two-bedroom detached dwelling and 2no. three-storey semi-detached dwellings (1no. three-bedroom and 1no. four-bedroom);
(iii) 3no. new vehicular entrances on Convent Avenue with on-site car parking for each dwelling;
(iv) Private amenity space comprising, for House 1: garden at ground level, screened terrace and balcony at second floor level, and rooftop terrace; for House 2: garden at ground level and screened terrace at second floor level and for House 3: garden at ground level;
(v) Reinstatement of original public footpath;
(vi) SuDs drainage and all associated works necessary to facilitate the development.

PROTECTED STRUCTURE (Ref.No: 5714 on Record of Protected Structures): Proposed alterations and additions to 2-storey terraced property (including both original rear return and modern single-storey rear extension). These works will consist inter alia, of:
(i) Alterations and extension of single-storey modern rear extension;
(ii) New ensuite and family bathroom to be located within rear first floor bedroom (with bedroom relocated to rear return in lieu bathroom)
(iii) New roof lights to rear (main roof) to principally facilitate attic storage area combined with new access stairs;
(iv) New up/ down sash windows to front and rear elevations in-lieu existing aluminium windows along with all necessary supporting ancillary works and minor associated alteration to existing fabric, services and drainage.

1) The demolition of an existing single-storey extension & canopy to the side;
2) The construction of a new single-storey porch extension to the front of existing dwelling;
3) A new vehicular access to the front serving the existing dwelling exiting onto Coultry Drive, Dublin 9.
4) The construction of a new 2-storey end of terrace dwelling to the side with off street parking for one car in the front garden.
5) A new vehicular access to serve the proposed dwelling exiting onto Coultry Drive.

The proposed development will consist of:
- Demolition of all existing buildings within the site;
- Construction of a 4 to 6 storey over part basement mixed use retail/ commercial building to include: Retail unit at the ground floor level fronting Baggot Street Upper; Office use to the rear at ground floor level at first to fifth floor levels, including ancillary staff facilities; Office storage area, retail storage area, plant room and shower facilities at basement level; Terrace/ breakout space at fourth floor level to the rear and terrace at fifth floor level to the front addressing Baggot Street Upper;
- Vehicular access from the existing access road to the rear (south-west) of the site via Flemings Place to undercroft car and cycle parking.
- All ancillary site works and services.

Alterations to previously permitted designs (Reg.Ref.3330/10 & WEB1099/14) consisting of:
a) The relocation of the existing gateway 2.0 m to the west and its increase in width from 2.7 m to 3.0 m and the provision of a separate pedestrian entrance;
b) The construction of a windowless underground plant-room/ storeroom; giving access between the courtyard and the rear garden;
c) The reduction of the area of the existing single-storey projecting annex/ roof terrace to the front from 20 sq.m to 12 sq.m;
d) The provision of a 20 sq.m single-storey (2.4 m high ceiling) return to the rear garden;
e) The increase of the floor to ceiling heights of the house from 2.7 m to 3.0 m;
f) The substitution of the permitted new pitched roof with a new green flat roof including low profile photovoltaic panels and roof lights, having a parapet 150 mm higher than the previously permitted ridge height; and
g) Minor internal alterations and redesign of fenestration.

The proposed development comprises the following internal and external alterations to the existing building:
a) Removal of existing  stairs at ground floor level leading to the caretaker's flat above and conversion of space into storage room together with the conversion of existing w.c. facilities to the rear of the reception to a staff tea room/ kitchen and an ancillary staff office;
b) Conversion of existing caretaker's/ manager's flat at first floor level and infilling of void (22 sq.m) to provide a new 3 bedroom (4 person) house type student accommodation unit (82 sq.m). Associated external alterations to the building involve the removal of a door to the northern flank elevation of the building, the subdivision of an existing balcony to the eastern elevation of the building and the provision of a door leading onto the subdivided balcony plus three new bedroom windows;
c) Provision of new hand railing to existing external stairs connecting upper first floor roof terrace with lower first floor level roof terrace;
d) Conversion of an existing oversized bedroom at second floor level into two separate single bedrooms whereby an existing 5-bedroom house type student accommodation unit is converted into a 6-bedroom house type student accommodation unit. Associated external alterations comprise the provision of one additional bedroom window and the infilling of one window and the enlargement of another existing window to the northern elevation of the building at second floor level;
e) Conversion of an existing oversized bedroom at third floor level into two separate single bedrooms whereby an existing 5-bedroom house type student accommodation unit is converted into a 6-bedroom house type student accommodation unit. Associated external alteration comprises the provision of one additional bedroom window and the infilling of one window and the enlargement of another existing window to the northern elevation of the building at third floor level. 
The proposed change of use and internal conversion works will result in the delivery of an additional 5 bedrooms and an associated uplift of 6 bed spaces of student accommodation within the existing facility. 
Other works include the provision of 3 no. ancillary bicycle parking spaces at ground floor level.

The development will comprise amendments to a previously issued Planning Permission (Reg. Ref. No. 3874/15), including:
(1) The construction of a new two storey substation building, area 690 sq.M;
(2) The addition of a transformer bay and associated fire wall to the transformer compound and reorientation of the compound on a north-south axis;
(3) The enlargement of the single storey client control building by 30 sq. m and its relocation to the north end of the compound;
(4) The consequent rearrangement of the compound access road and fencing; the combined gross floor area of all additional proposed buildings is 720 sq. m.

RETENTION: Retention permission is sought for minor alterations to previously approved development Reg. Ref. WEB1134/11. Alterations comprise the following: 
(i) Rear dormer windows changed from flat roof to pitched roof;
(ii) Relocation of chimney on western roof slope;
(iii) Provision of a hipped roof dormer to the western roof slope with permanent opaque glazing
(iv) Outer wall on western elevation altered from angled to stepped alignment with no increase in floor area and omission of 2no. windows;
(v) Ground floor extension to rear extended in-depth by 0.3m and stepped in from the western elevation by 0.37m with door ope changed to window ope;
(vi) Provision of internal steps and reduced floor level to kitchen / dining / living area at rear.

The proposed development will consist of amendments to a previously permitted 6 storey development (Reg. Ref. 3312/13 as modified by 4198/15) including the following elements:
1) Relocation of permitted plant (currently shown at 5th floor) to a new rooftop plant enclosure with a footprint of approximately 8.8m wide and 17m long, enclosed by 1.8m high louvered screen to match the height of the previously approved roof plant enclosure screens:
2) Change to of use of vacated 5th floor plant area (c.75m2) to office (no change overall to the already permitted gross floor area); 
3) Replacement of the permitted louvers to the vacated 5th floor plant room with glazing to match the rest of the facade;
4) Installation of Ice Bank Thermal storage within permitted basement (-1);
5) All other associated and ancillary development and site works above and below ground.

Planning permission is sought comprising of 
